import React from 'react';
import './ProjectSection.css';

function ProjectSection() {
    return (
        <div className="projectsection">
            <h2>Projects</h2>
            <p>
                <u>Simple Bitcoin Widget</u>
                <br></br>
                A clean and minimal Bitcoin price widget for Android.
            </p>

            <p>
                <u>Project #2</u>
                <br></br>
                Project description
            </p>

            <p>
                <u>Project #3</u>
                <br></br>
                Project description
            </p>

        </div>
    );
}

export default ProjectSection;
